import React from "react";

class PerformCalculations extends React.Component {
  state = {
    calculations: []
  };

  componentDidMount() {}

  getCalculations = () => {
    fetch("http://localhost:4000/calculations")
      .then(response => response.json())
      .then(({ data }) => console.log(data))
      .catch(err => console.log(err));
  };

  renderCaculation = ({
    id,
    first_num,
    second_num,
    sum_result,
    product_result,
    power_result
  }) => {
    <div key={id}> first_num </div>;
  };

  render() {
    const calculations = this.state.calclulations;
    return <div>{calculations.map(this.renderCaculation)}</div>;
  }
}

export default PerformCalculations;
